import React from 'react';
import ReactDOM from 'react-dom';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

import App from './App';
import SellerStoreList from './pages/SellerStoreList'

ReactDOM.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<SellerStoreList/>} />
    </Routes>
  </BrowserRouter>,
  document.getElementById('root')
);
